def solve(start, end):
    count = 0
    for num in range(start, end+1):
        if num >= 0 and num <= 9:
            count += 1
        elif num >= 10 and num <= 15:
            count += 1
        else:
            while num > 0:
                remainder = num % 16
                if remainder >= 0 and remainder <= 9:
                    count += 1
                elif remainder >= 10 and remainder <= 15:
                    count += 1
                num = num // 16
    return count
